import React, { useState } from 'react';

var properties = [
    'name',
    'wins',
    'draws',
    'losses',
    'total',
];

$.each( properties, function( i, val ) {

    var orderClass = '';

    $("#" + val).click(function(e){
        e.preventDefault();
        $('.filter__link.filter__link--active').not(this).removeClass('filter__link--active');
        $(this).toggleClass('filter__link--active');
        $('.filter__link').removeClass('asc desc');

        if(orderClass == 'desc' || orderClass == '') {
            $(this).addClass('asc');
            orderClass = 'asc';
        } else {
            $(this).addClass('desc');
            orderClass = 'desc';
        }

        var parent = $(this).closest('.header__item');
        var index = $(".header__item").index(parent);
        var $table = $('.table-content');
        var rows = $table.find('.table-row').get();
        var isSelected = $(this).hasClass('filter__link--active');
        var isNumber = $(this).hasClass('filter__link--number');

        rows.sort(function(a, b){

            var x = $(a).find('.table-data').eq(index).text();
            var y = $(b).find('.table-data').eq(index).text();

            if(isNumber == true) {

                if(isSelected) {
                    return x - y;
                } else {
                    return y - x;
                }

            } else {

                if(isSelected) {
                    if(x < y) return -1;
                    if(x > y) return 1;
                    return 0;
                } else {
                    if(x > y) return -1;
                    if(x < y) return 1;
                    return 0;
                }
            }
        });

        $.each(rows, function(index,row) {
            $table.append(row);
        });

        return false;
    });

});

function Table() {
    const [searchTerm, setSearchTerm] = useState('');

    const handleSearch = (event) => {
        setSearchTerm(event.target.value);
    };

    const filteredData = data.filter((item) =>
        item.gender.toLowerCase().includes(searchTerm.toLowerCase())
    );

    return (
        <div>
        <p>Sort Table Rows by Clicking on the Table Headers - Ascending and Descending (jQuery)</p>
    <div className="container">

        <div className="table">
            <div className="table-header">
                <div className="header__item"><a id="name" className="filter__link" href="#">Name</a></div>
                <div className="header__item"><a id="wins" className="filter__link filter__link--number"
                                                 href="#">Wins</a></div>
                <div className="header__item"><a id="draws" className="filter__link filter__link--number"
                                                 href="#">Draws</a></div>
                <div className="header__item"><a id="losses" className="filter__link filter__link--number"
                                                 href="#">Losses</a></div>
                <div className="header__item"><a id="total" className="filter__link filter__link--number"
                                                 href="#">Total</a></div>
            </div>
            <div className="table-content">
                <div className="table-row">
                    <div className="table-data">Tom</div>
                    <div className="table-data">2</div>
                    <div className="table-data">0</div>
                    <div className="table-data">1</div>
                    <div className="table-data">5</div>
                </div>
                <div className="table-row">
                    <div className="table-data">Dick</div>
                    <div className="table-data">1</div>
                    <div className="table-data">1</div>
                    <div className="table-data">2</div>
                    <div className="table-data">3</div>
                </div>
                <div className="table-row">
                    <div className="table-data">Harry</div>
                    <div className="table-data">0</div>
                    <div className="table-data">2</div>
                    <div className="table-data">2</div>
                    <div className="table-data">2</div>
                </div>
            </div>
        </div>
    </div>
        </div>
    );
};

export default Table;
